import React from "react";

const ColoredBox = ({ image, name, title }) => {
  const bColor = {
    backgroundColor: "red",
    border: "5px solid black",
  };

  return (
    <div className="box" style={bColor}>
      <img src={image} alt="" />
      <h1>{name}</h1>
      <h1>{title}</h1>
    </div>
  );
};

export default ColoredBox;
